itaret sui! Cur tandem? Quae cum essent dicta, discessimus. Ne discipulum abducam, times. <em>Bonum integritas corporis: misera debilitas.</em> Omnia peccata paria dicitis.</p>\n<ol><li>Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam;</li><li>Cum sciret confestim esse moriendum eamque mortem ardentiore studio peteret, quam Epicurus voluptatem petendam putat.</li><li>Sed tu istuc dixti bene Latine, parum plane.</li></ol>\n<p><mark>Tenent mordicus.</mark> Immo alio genere;</p>\n<p><em>Nescio quo modo praetervolavit oratio.</em> Quis non odit sordidos, vanos, leves, futtiles? Tum mihi Piso: Quid ergo? Quid ergo? Cur id non ita fit? <strong>Deinde disputat, quod cuiusque generis animantium statui deceat extremum.</strong></p>\n<p>Quae duo sunt, unum facit. Non autem hoc: igitur ne illud quidem. Si longus, levis dictata sunt. Quamquam tu hanc copiosiorem etiam soles dicere. Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. Sed haec omittamus;</p>\n<p>Et nemo nimium beatus est; Nihil sane. <strong>Honesta oratio, Socratica, Platonis etiam.</strong> <strong>Non potes, nisi retexueris illa.</strong> Nemo igitur esse beatus potest. Esse enim, nisi eris, non potes.</p>\n<p>Bonum negas esse divitias, praepostum esse dicis? Negare non possum. Quae quidem sapientes sequuntur duce natura tamquam videntes; Peccata paria. Quodsi ipsam honestatem undique pertectam atque absolutam. Quae diligentissime contra Aristonem dicuntur a Chryippo. Nihilo magis. Haeret in salebra.</p><ol><li>Inde sermone vario sex illa a Dipylo stadia confecimus.</li><li>At multis malis affectus.</li><li>Mene ergo et Triarium dignos existimas, apud quos turpiter loquare?</li><li>Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus;</li><li>Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis.</li><li>Itaque his sapiens semper vacabit.</li></ol>\n<p>An hoc usque quaque, aliter in vita? Bona autem corporis huic sunt, quod posterius posui, similiora. Qui ita affectus, beatum esse numquam probabis; Equidem etiam Epicurum, in physicis quidem, Democriteum puto.</p>\n<p>Haeret in salebra. Cur, nisi quod turpis oratio est?</p>\n<p>Philosophi autem in suis lectulis plerumque moriuntur. Haeret in salebra. Tubulo putas dicere?</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(124,264,1,'2022-02-19 18:45:45','2022-02-19 18:45:45','1541ed2a-7e1a-4454-b590-8eeea1a89418',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Itaque contra est, ac dicitis; Quae duo sunt, unum facit. Tibi hoc incredibile, quod beatissimum. Duo Reges: constructio interrete. <strong>Hoc loco tenere se Triarius non potuit.</strong></p>\n<ul><li>Universa enim illorum ratione cum tota vestra confligendum puto.</li><li>Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim.</li><li>Quem quidem vos, cum improbis poenam proponitis, inpetibilem facitis, cum sapientem semper boni plus habere vultis, tolerabilem.</li></ul>\n\n<p>Dic in quovis conventu te omnia facere, ne doleas. <em>Sed quanta sit alias, nunc tantum possitne esse tanta.</em> Restatis igitur vos; Quid est enim aliud esse versutum?</p>\n<p>Haeret in salebra. <em>Sequitur disserendi ratio cognitioque naturae;</em></p>\n<ul><li>Dolere malum est: in crucem qui agitur, beatus esse non potest.</li><li>Invidiosum nomen est, infame, suspectum.</li><li>Sed et illum, quem nominavi, et ceteros sophistas, ut e Platone intellegi potest, lusos videmus a Socrate.</li></ul>\n<p>Non autem hoc: igitur ne illud quidem. Bestiarum vero nullum iudicium puto. Haec dicuntur inconstantissime. Quam illa ardentis amores excitaret sui! Cur tand