INSERT INTO `stc_6_items` VALUES (22,516,2,'2022-02-21 04:22:54','2022-02-21 04:22:54','41558a52-0272-4824-8150-03eed49df793','Lorem ipsum','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Duo Reges: constructio interrete. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Qui non moveatur et offensione turpitudinis et comprobatione honestatis?</p>'),(23,517,2,'2022-02-21 04:22:54','2022-02-21 04:22:54','673773a2-05d7-48fa-9cd4-fd5f27f2381f','Chrysippo praetermissum','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem sequens idem faciam. Quid est, quod ab ea absolvi et perfici debeat? Idem iste, inquam, de voluptate quid sentit? Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi.</p>'),(24,518,2,'2022-02-21 04:22:54','2022-02-21 04:22:54','3c06c305-afb7-4a0b-b513-60d7bf47cebb','Nummus in Croesi','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. Quae si potest singula consolando levare, universa quo modo sustinebit? Frater et T. Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus.</p>'),(51,904,2,'2022-02-22 03:24:10','2022-02-22 22:25:28','f1793078-3c17-422c-9715-02b9207b0cae','Lorem ipsum','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus duo reges.</p>'),(52,905,2,'2022-02-22 03:24:10','2022-02-22 22:25:28','5b83878a-cedc-49a3-84d1-0837c549ac3e','Quid est quod','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem sequens idem.</p>'),(53,906,2,'2022-02-22 03:24:10','2022-02-22 22:25:28','61dbd9da-73de-4893-ba80-ae8c11d501aa','Nummus in Croesi','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite fluere necesse est omnem rationem bonorum et.</p>'),(95,969,2,'2022-02-22 03:26:49','2022-02-22 22:27:53','03508641-348e-436d-a2a4-0e5e698b2d7e','Duo Reges','<p>Tria genera bonorum; Vide, quantum, inquam, fallare, Torquate. Primum quid tu dicis breve? Laboro autem non sine causa constructio interrete.</p>'),(96,970,2,'2022-02-22 03:26:49','2022-02-22 22:27:53','3da08b78-e67d-43f9-baf8-5150b3a0e052','Lorem ipsum','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus</p>'),(97,971,2,'2022-02-22 03:26:49','2022-02-22 22:31:52','92cd84f7-024b-455e-9080-0f2274279a84','Quid est quod','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem.</p>'),(98,972,2,'2022-02-22 03:26:49','2022-02-22 22:27:53','a88f7755-4988-4e7d-9491-be205ec9cd4f','Nummus in Croesi','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum.</p>'),(312,2672,2,'2022-02-22 21:46:36','2022-02-23 02:00:56','d999c630-8318-4389-aaa8-4f91663d6069','Lorem ipsum','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus</p>'),(313,2673,2,'2022-02-22 21:46:36','2022-02-23 02:00:56','0988ccd9-d843-48a4-9c27-44c8ff9d6671','Quid est quod','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem sequens idem faciam.</p>'),(314,2674,2,'2022-02-22 21:46:36','2022-02-23 02:00:56','f4ebe143-90e5-4c5d-a14e-60dfdcd020a6','Nummus in Croesi','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite 